import React from "react";
import "./Content.css";

const Content = () => {
  return (
    <div className="content">
      <div className="left-side">
        <div className="text">
          <p>Interior Needs</p>
          <h2>Various new collections of furniture</h2>
          <h2>to decorate your house corner</h2>
          <button>Shop Now</button>
        </div>
