          src="https://png.pngtree.com/png-vector/20240615/ourmid/pngtree-a-vector-illustration-of-small-house-with-porch-depicted-on-white-png-image_12642457.png"
          alt="Home Decor"
          className="homeImg"
        />
      </div>
    </div>
  );
};

export default Content;
